description:
Verenigde Staten
Komedie
104 minuten

geregisseerd door Andy Fickman
met Billy Crystal, Bette Midler en Marisa Tomei

Artie wordt alleen achtergelaten om voor zijn drie kleinkinderen  te zorgen wanneer zijn dochter Alice op zakenreis gaat.  Hij probeert de kinderen discipline bij te brengen op een moderne manier, maar zoekt al snel zijn toevlucht tot de ouderwetse opvoedingsmethodes.



Nl-ENG subs



